import React from 'react';
import Layout from '../components/Layout';
import Fetch from 'isomorphic-unfetch';
import Prices from '../components/Prices';

const index = (props) => (
    <Layout>
        <div>
            <h1>Welcome to BitzPrice!</h1>
            <Prices />
        </div>
    </Layout>
);



export default index;
